	this.frame_60 = function() {
		// Variable untuk menyimpan referensi timeline
		var self = this;
		
		// Menghentikan Timeline
		this.stop();
		
		if (this.home) this.home.removeAllEventListeners("click");
		
		// --- AKSES DAN HITUNG SKOR ---
		// Variabel skor (this.QUIZ_COUNT, this.correct, this.wrong) dibawa dari frame kuis
		
		var total = this.QUIZ_COUNT;
		var benar = this.correct;
		var salah = this.wrong;
		
		// Hitung persentase
		var persen = (total > 0) ? (benar / total) * 100 : 0;
		
		// --- TAMPILKAN HASIL ---
		
		// Pengaturan TextField (autoSize hanya tersedia untuk TextField dinamis)
		if (this.score_txt) {
		    // Di CreateJS, autoSize diatur di Animate properties atau dihilangkan
		    // Kita hanya perlu menyetel teksnya
		    this.score_txt.text = "Benar: " + benar + "    Salah: " + salah;
		}
		
		if (this.percent_txt) {
		    // Tambahkan simbol persen secara eksplisit untuk kejelasan
		    this.percent_txt.text = persen.toFixed(0); 
		}
		
		
		// --- PASANG LISTENER IKON DAN NAVIGASI ---
		
		// Listener Musik (Asumsi this.music_on/this.music_off didefinisikan global)
		if (this.unmute) { this.unmute.on("click", this.music_on.bind(this)); }
		if (this.mute) { this.mute.on("click", this.music_off.bind(this)); }
		
		// Listener Bantuan (Asumsi this.showHelp/this.hideHelp didefinisikan global)
		if (this.help_btn) { this.help_btn.on("click", this.showHelp.bind(this)); }
		if (this.help_panel && this.help_panel.close_btn) { this.help_panel.close_btn.on("click", this.hideHelp.bind(this)); }
		
		
		// Listener Navigasi Home (Pengganti home.addEventListener(MouseEvent.CLICK, to_home))
		if (this.home) { this.home.on("click", this.to_home.bind(this)); }
		
		console.log("=== HASIL KUIS ===");
		console.log("Total Soal:", total);
		console.log("Benar:", benar);
		console.log("Salah:", salah);
		console.log("Persentase:", persen.toFixed(0) + "%");
	}

